class CNNModel:
    def __init__(self, path_to_model_directory="MODEL", checkpoint_name="checkpoint_final.pth", folds=(4,)):
        self.model = self.prepare_cnn(path_to_model_directory, checkpoint_name, folds)

    def prepare_cnn(self, path_to_model_directory="MODEL", checkpoint_name="checkpoint_final.pth", folds=(4,)):
        """
        :param path_to_model_directory: must have dataset.json & folder containing the fold e.g. fold_4/checkpoint_final.pth
        :param checkpoint_name: e.g. checkpoint_final.pth
        :param folds: tuple of folds e.g. (4,)
        :return:
        The model which is prepared to predict
        """
        print(f"GPU: {torch.cuda.get_device_name(0)}")
        predictor = nnUNetPredictor(
            tile_step_size=1,
            use_gaussian=True,
            use_mirroring=True,
            perform_everything_on_gpu=True,
            device=torch.device('cuda', 0),
            verbose=False,
            verbose_preprocessing=False,
            allow_tqdm=False
        )
        predictor.initialize_from_trained_model_folder(path_to_model_directory, checkpoint_name=checkpoint_name,
                                                       use_folds=folds)
        return predictor

    async def image_callback_cnn(self, image_data):
        if "imageStream" in image_data:
            """
            Data sample:
            Response: {'value': {'context': {'system': {'manufacturer': 'SIEMENS', 'manufacturerModel': 'Aera', 'magneticFieldStrength': 1.5}, 'general': {'frameOfReference': '1.3.12.2.1107.5.0.0.1000000.2.20220714011701318.0.0.0', 'protocolName': 'TestProtocol', 'sequenceName': '*tfi3d1_42', 'seriesName': 'tfi3D_nav_fs_Whole-Heart', 'seriesUUID': '1.3.12.2.1107.5.0.0.1000000.20220714011701317', 'tablePosition': {'cor': 0.0, 'sag': 0.0, 'tra': 0.0}}}, 'image': {'format': 'raw16bit', 'data': '', 'acquisition': {'date': '20240204', 'time': '215548.580', 'type': ['ORIGINAL'], 'instanceNumber': 0, 'sliceIndex': 0, 'acquisitionParameters': {'TE': 1.58, 'TR': 255.45, 'flipAngle': 90.0, 'dimension': '3D'}}, 'dimensions': {'columns': 128, 'rows': 128, 'voxelSize': {'column': 2.34375, 'row': 2.34375, 'slice': 2.0}, 'rawDataSize': {'bitsAllocated': 16, 'bitsUsed': 12}}, 'coordinates': {'inplanePhaseEncodingDirection': 'COL', 'mrSlicePcs': {'position': {'cor': 0.0, 'sag': 0.0, 'tra': 0.0}, 'normal': {'cor': 0.0, 'sag': 0.0, 'tra': -1.0}, 'read': {'cor': 0.0, 'sag': 1.0, 'tra': 0.0}, 'phase': {'cor': 1.0, 'sag': 0.0, 'tra': 0.0}}, 'mrSliceDcs': {'position': {'x': 0.0, 'y': 0.0, 'z': 0.0}, 'normal': {'x': 0.0, 'y': 0.0, 'z': 1.0}, 'read': {'x': 1.0, 'y': 0.0, 'z': 0.0}, 'phase': {'x': 0.0, 'y': -1.0, 'z': 0.0}}, 'dicomPcs': {'position': {'cor': -150.0, 'sag': -150.0, 'tra': 0.0}, 'normal': {'cor': 0.0, 'sag': 0.0, 'tra': -1.0}, 'row': {'cor': 0.0, 'sag': 1.0, 'tra': 0.0}, 'column': {'cor': 1.0, 'sag': 0.0, 'tra': 0.0}}, 'dicomDcs': {'position': {'x': -150.0, 'y': 150.0, 'z': 0.0}, 'normal': {'x': 0.0, 'y': 0.0, 'z': 1.0}, 'row': {'x': 1.0, 'y': 0.0, 'z': 0.0}, 'column': {'x': 0.0, 'y': -1.0, 'z': 0.0}}}, 'windowing': {'center': 1187.0, 'width': 2374.0, 'minPixelValue': 0, 'maxPixelValue': 2374}}}}
            """
            image_data = json.loads(json.dumps(image_data), object_hook=lambda d: SimpleNamespace(**d))
            image_data = image_data[2].value.image.data
            decoded_data = base64.b64decode(image_data)
            try:
                image_array = np.frombuffer(decoded_data, dtype=np.uint8)
                image = cv2.imdecode(image_array, cv2.IMREAD_GRAYSCALE)
                image = cv2.resize(image, (512, 512)).astype(np.float32) / 255.0
                cnn_input = image.reshape(1, 1, image.shape[0], image.shape[1])
                props = {'spacing': (999, 1, 1)}
                output = self.model.predict_single_npy_array(cnn_input, props, None, None, True)[0]
                output_display = (output * 255).astype(np.uint8).reshape(512, 512)
                image_display = (image * 255).astype(np.uint8)
            except Exception as error:
                print(f"Error in callback: {error}")


def draw_spline(image_data):
    spline_points = []
    labels = measure.label(image_data > 128)
    properties = measure.regionprops(labels)
    centers = np.array([prop.centroid for prop in properties])
    if len(centers) > 1:
        tck, _ = splprep(centers.T, s=0)
        spline_points = splev(np.linspace(0, 1, 1000), tck)
    return spline_points


def run_websocket_in_thread(session_id, callback_function):
    loop = asyncio.new_event_loop()
    asyncio.set_event_loop(loop)
    loop.run_until_complete(Access.connect_websocket(session_id, callback_function))


Access = access_library.Access("127.0.0.1")
Model = CNNModel()

